window.bookSummaryJSON = "<p><b>Looking for love on all the wrong planets? Try the Star-Crossed Dating Agency.</b></p> <p>Born without a dragon’s spirit, Vykor has no magic, no clan, and no reason to stay on his home planet of Romak.</p> <p>He’s come to Earth to research old legends - and maybe even find acceptance.</p> <p>This audiobook contains an executive assistant in need of assistance and a researcher who is about to discover that love doesn’t come with instructions.</p>"; 
